import React, { useEffect, useRef, useState } from 'react';
import {
  GoogleMap,
  Marker,
  InfoWindow,
  useLoadScript,
} from '@react-google-maps/api';

const containerStyle = {
  width: '100%',
  height: '80vh',
};

const libraries = ['places'];

const Maps = () => {
  const [currentPosition, setCurrentPosition] = useState(null);
  const [places, setPlaces] = useState([]);
  const [selectedPlace, setSelectedPlace] = useState(null);
  const [loading, setLoading] = useState(true);
  const mapRef = useRef(null);

  const { isLoaded, loadError } = useLoadScript({
    googleMapsApiKey: 'AIzaSyAH8Mqz2Jazg0Q0tM_XA27CSgzRqS7v2Kk',
    libraries,
  });

  useEffect(() => {
    navigator.geolocation.getCurrentPosition(
      (position) => {
        const pos = {
          lat: position.coords.latitude,
          lng: position.coords.longitude,
        };
        setCurrentPosition(pos);
        setLoading(false);
      },
      (err) => {
        console.error('Geolocation failed:', err);
        setCurrentPosition({ lat: 20.5937, lng: 78.9629 }); // Fallback: center of India
        setLoading(false);
      }
    );
  }, []);

  const onMapLoad = (map) => {
    mapRef.current = map;

    const service = new window.google.maps.places.PlacesService(map);

    const request = {
      location: currentPosition,
      radius: 10000, // 10 km
      keyword: 'kabadiwala scrap collector e-waste',
    };

    service.nearbySearch(request, (results, status) => {
      if (status === window.google.maps.places.PlacesServiceStatus.OK) {
        // Sort by distance (approximation)
        const sorted = results.map((place) => ({
          ...place,
          distance: haversineDistance(currentPosition, {
            lat: place.geometry.location.lat(),
            lng: place.geometry.location.lng(),
          }),
        })).sort((a, b) => a.distance - b.distance);

        setPlaces(sorted);
      } else {
        console.error('PlacesService failed:', status);
      }
    });
  };

  // Helper to calculate distance (in km)
  function haversineDistance(pos1, pos2) {
    const toRad = (x) => (x * Math.PI) / 180;
    const R = 6371;
    const dLat = toRad(pos2.lat - pos1.lat);
    const dLng = toRad(pos2.lng - pos1.lng);
    const a =
      Math.sin(dLat / 2) ** 2 +
      Math.cos(toRad(pos1.lat)) *
        Math.cos(toRad(pos2.lat)) *
        Math.sin(dLng / 2) ** 2;
    const c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1 - a));
    return R * c;
  }

  if (loadError) return <p>Error loading maps</p>;
  if (!isLoaded || loading) return <p>Loading...</p>;

  return (
    <div className="p-6">
      <h2 className="text-2xl font-bold mb-4">Nearest E-Waste Collection Centers</h2>
      <GoogleMap
        mapContainerStyle={containerStyle}
        center={currentPosition}
        zoom={13}
        onLoad={onMapLoad}
      >
        {/* User Location */}
        {currentPosition && (
          <Marker
            position={currentPosition}
            icon={{
              url: 'http://maps.google.com/mapfiles/ms/icons/blue-dot.png',
            }}
          />
        )}

        {/* Found Places */}
        {places.map((place, idx) => (
          <Marker
            key={idx}
            position={{
              lat: place.geometry.location.lat(),
              lng: place.geometry.location.lng(),
            }}
            onClick={() => setSelectedPlace(place)}
          />
        ))}

        {selectedPlace && (
          <InfoWindow
            position={{
              lat: selectedPlace.geometry.location.lat(),
              lng: selectedPlace.geometry.location.lng(),
            }}
            onCloseClick={() => setSelectedPlace(null)}
          >
            <div>
              <h3 className="font-semibold">{selectedPlace.name}</h3>
              {selectedPlace.vicinity && <p>{selectedPlace.vicinity}</p>}
              <p>Distance: {selectedPlace.distance.toFixed(2)} km</p>
            </div>
          </InfoWindow>
        )}
      </GoogleMap>
    </div>
  );
};

export default Maps;
